<div class="entities" style="line-height: 2.5; direction: ltr">Endothelin receptor antagonists as disease modifiers in systemic sclerosis . Systemic sclerosis ( SSc ) is a multisystem connective tissue disease of unknown etiology that is characterized by inflammation , vascular dysfunction and fibrosis of the skin and visceral organs . SSc is clinically diverse both in terms of the burden of skin and organ involvement and the rate of progression of the disease . Recent studies indicate that the endothelin system , especially ET - 1 and the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and ETB receptors may play a key role in the pathogenesis of SSc . A new class of drugs , endothelin receptor antagonists has been introduced for treatment of patients with pulmonary arterial hypertension ( PAH ) . DB00559 , a dual endothelin receptor antagonist as well as DB06268 and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06403
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , selective blockers of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor have proven effective in SSc-PAH . This effect may be mediated through both a vasodilatory and antifibrotic effect , thus making these agents attractive as potential disease modifying agents for SSc .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Hsp 27 regulates epithelial mesenchymal transition , metastasis , and circulating tumor cells in prostate cancer . Defining the mechanisms underlying metastatic progression of prostate cancer may lead to insights into how to decrease morbidity and mortality in this disease . An important determinant of metastasis is epithelial-to-mesenchymal transition ( EMT ) , and the mechanisms that control the process of EMT in cancer cells are still emerging . Here , we report that the molecular chaperone Hsp 27 (

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Lack of pharmacokinetic interactions between argatroban and warfarin . The potential for pharmacokinetic interactions between argatroban and warfarin was studied . In a randomized , crossover study , healthy volunteers participated in three treatment periods , each separated by a nine-day washout interval . Drug regimens consisted of a single oral 7.5- mg dose of warfarin , intravenous argatroban infused at a rate of 1.25 micrograms / kg / min for 100 hours , or both . Blood samples were collected at intervals up to 104 hours to determine clearance ( CL ) and the apparent first-order elimination rate constant ( kel ) for argatroban and the area under the concentration-versus-time curve ( AUC ) and maximum concentration ( Cmax ) for R - and S-warfarin . An interaction was defined as a &gt; 25 % difference in the magnitude of the pharmacokinetic values between administration of one drug alone and coadministration with the other agent . Twelve adult subjects were enrolled . The mean CL and lel for argatroban administered alone differed by &lt; 7 % from the mean values when the two drugs were coadministered . When warfarin was administered alone , the mean Cmax and AUC of R - and S-warfarin differed from the mean values when the two drugs were coadministered by &lt; 10 % . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 time was prolonged comparably when argatroban was administered alone and with warfarin . No deaths or serious adverse events were reported . No significant pharmacokinetic interactions were detected between i . v . argatroban 1.25 micrograms / kg / min and a single 7.5- mg oral dose of warfarin . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Enhancement of antibody responses to Bacillus anthracis protective antigen domain IV by use of calreticulin as a chimeric molecular adjuvant . The generation of protective humoral immune responses against the receptor-binding domain ( domain IV ) of protective antigen [ PA ( dIV ) ] of Bacillus anthracis represents a plausible approach against anthrax toxin . In the current study , we have developed a naked DNA vaccine encoding calreticulin ( CRT ) linked to PA ( dIV ) of Bacillus anthracis [ CRT / PA ( dIV ) ] . We transfected a human embryonic kidney cell line ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 dependent , since 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 knockout mice demonstrated a significant reduction in antibody responses . In addition , analysis of the titers and avidity maturation of the induced PA-specific antibodies revealed that vaccination with CRT / PA ( dIV ) DNA vaccine accelerated the avidity maturation of antibodies to PA ( dIV ) compared to vaccination with PA ( dIV ) DNA . Importantly , the enhanced antibody responses correlated to protective immunity against lethal anthrax toxin challenge . Thus , DNA vaccines encoding CRT linked to PA ( dIV ) may dramatically enhance PA-specific protective antibody responses . Our results have significant clinical applications for biodefense against anthrax toxin .</div>
